import React from 'react'
import { Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink } from 'reactstrap'
import DropDown from '../Tools/DropDown/DropDown'
import DropDownNav from '../Tools/DropDownNav/DropDownNav'
import '../../Styles/Navigation/Navigation.css'
import SearchModal from '../Searchs/SearchModal/SearchModal'
import JoinModal from '../Tools/JoinModal/JoinModal'

export default class Navigation extends React.Component {
  constructor() {
    super()

    this.state = {
      isShowing: false
    }
  }

  openModalHandler = () => {
    this.setState({
      isShowing: true
    })
  }

  closeModalHandler = () => {
    this.setState({
      isShowing: false
    })
  }
  render() {
    return (
      <div>
        {this.state.isShowing ? (
          <div onClick={this.closeModalHandler} className='back-drop' />
        ) : null}
        <Navbar color='faded' light>
          <NavbarBrand href='/' className='mr-auto'>
            LOCALIFY
          </NavbarBrand>
          <DropDownNav />
          <DropDown />
          <SearchModal />
          <button className='open-modal-btn' onClick={this.openModalHandler}>
            Open Modal
          </button>

          <Modal className='modal' show={this.state.isShowing} close={this.closeModalHandler}>
            Maybe aircrafts fly very high because they don't want to be seen in plane sight?
          </Modal>
          <div id='content' />
        </Navbar>
      </div>
    )
  }
}
